import '../../App.css'
import React from 'react';
import styled from 'styled-components'
import imgRestaurants from "../../images/restaurants.png"

const Restaurants = styled.div`

background-image: url(${imgRestaurants});

& h3 {

color: white;
font-weight: bold;

}
  `

export default () => {
    return (
        <div>
            <Restaurants>
               <h3 className="align-content-center">RESTAURANTS</h3>
            </Restaurants>

        </div>
    )

}
